import { useState , useEffect } from "react";
import {BarChart } from "./components/BarChart";
import { BarchartMockData} from "./components/MockData";


export const DashboardPage = () => {


  const [mockData ,  setMockData ] =useState<JSON[]> ([]);

  useEffect(() => {

    let BarChartResponse: any[] = BarchartMockData();

    for (const key in BarChartResponse ) {
      mockData.push( BarChartResponse[key].json() );

    }

    setMockData(mockData);


  },[])






    return (
    <> 
      <div className="m-20">
        <div className="d-flex justify-content-space-between align-items-center">
          <h1>Dashboard</h1>
        </div>
        <div className="d-flex justify-content-space-between align-items-center">
          <h2>Welcome to your dashboard</h2>
        </div>

      <BarChart data={mockData} /> 
      </div>


      <div className="container m-2 p-2 d-flex">
        <div className="d-flex justify-content-center align-items-center card-header">
          <h3>Card Header</h3>
          </div>

          <div className="card-body justify-content align-items-center">
            <h5>Card Body</h5> 

          </div>
      </div>
    </>
  );
};
